  namespace: Azure.Iot.Operations.Protocol.Telemetry
  summary: A timestamp attached to the telemetry message.
  remarks: >-
    This value is nullable only because a received message may not have sent it. Any message sent by 

    <xref href="Azure.Iot.Operations.Protocol.Telemetry.TelemetrySender%601" data-throw-if-not-resolved="false"></xref> will include a non-null timestamp. A message sent by anything else

    may or may not include this timestamp.
